import React from 'react';

const MyComponent = props => {
    return (
        <div>
            hi, my name is {props.name}! <br/>
            children is {props.children}!
        </div>
    );
};
MyComponent.defaultProps = {
    name: '기본이름'
};

export default MyComponent;
